import React, { useState, useEffect } from "react";
import "./googledrive.css";
import { Fade, Button, Row, Col } from 'reactstrap';
//import { useEffect } from "react";

import MenuSuperior from '../menuSuperior/MenuSuperior';



const GoogleDrive = (props) => {


  const [fadeIn1, setFadeIn1] = useState(true);
  const [fadeIn2, setFadeIn2] = useState(true);
  const [fadeIn3, setFadeIn3] = useState(true);

  const toggle1 = () => setFadeIn1(!fadeIn1);
  const toggle2 = () => setFadeIn2(!fadeIn2);
  const toggle3 = () => setFadeIn3(!fadeIn3);

  function toggle() {
    var display = document.getElementById(scroll).style.display;
    if(display == "none")
        document.getElementById(scroll).style.display = 'block';
    else
        document.getElementById(scroll).style.display = 'none';
}
 
  return (
    <React.Fragment>

    <div>
        <MenuSuperior />


    </div>
    <div >
      <div className="googleDrive">
        <h1 className="tittle">Download de Arquivos</h1>
      </div>
      <div>
        <Row>
          <Col sm={4}>
            <Button color="primary" onClick={toggle}>Toggle Fade</Button>
          </Col>
          <Col sm={4}>
            <Button color="primary" onClick={toggle2}>Toggle Fade</Button>
          </Col>
          <Col sm={4}>
            <Button color="primary" onClick={toggle3}>Toggle Fade</Button>
          </Col>
        </Row>

          <div id="fade" >
          <Row>
          <Col sm={12} >
            <Fade in={fadeIn1} tag="h5" className="mt-3">
              <center >
                {/*<iframe src="https://googledriveembedder.collegefam.com/?key=AIzaSyBxXtlZCc1ocHHoG6cHDilaxdw2GCYf5Jc&folderid=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH"></iframe>*/}
                <iframe id="scroll"  src="https://drive.google.com/embeddedfolderview?id=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH#grid"></iframe>
              </center>
            </Fade>
          </Col>
        </Row>
        <Row>
          <Col sm={12}>
            <Fade in={fadeIn2} tag="h5" className="mt-3">
              <center>
                {/*<iframe src="https://googledriveembedder.collegefam.com/?key=AIzaSyBxXtlZCc1ocHHoG6cHDilaxdw2GCYf5Jc&folderid=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH"></iframe>*/}
                  <iframe id="scroll"  src="https://drive.google.com/embeddedfolderview?id=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH#grid"></iframe>
              </center>
            </Fade>
            </Col>
        </Row>
        <Row>
        <Col sm={12}>
            <Fade in={fadeIn3} tag="h5" className="mt-3">
              <center>
                {/*<iframe src="https://googledriveembedder.collegefam.com/?key=AIzaSyBxXtlZCc1ocHHoG6cHDilaxdw2GCYf5Jc&folderid=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH"></iframe>*/}
                  <iframe className="hide" id="scroll"  src="https://drive.google.com/embeddedfolderview?id=1z39TV9L1RmOyEkkR2LQqPayk5GIDwYgH#grid"></iframe>
              </center>
            </Fade>
            </Col>
        </Row>
          </div>
      </div>
    </div>
    </React.Fragment>
  );
};

export default GoogleDrive;
